description:
Nós somos a Indeov, a primeira empresa de consultoria especializada em Cannabis Medicinal no Brasil.

Somos guiados por um propósito claro: conectar pacientes e médicos a produtores de Cannabis Medicinal, promovendo qualidade de vida a Pacientes e Familiares.

Para isso, trabalhamos com paixão e espírito de excelência, desenvolvendo posicionamento de marcas no Brasil, auxiliando nossos Médicos Parceiros com uma Equipe Multidisciplinar Especializada e cuidando de Pacientes de todas as idades.

Com experiência internacional em mercado regulado, programa de suporte ao paciente, consultoria técnica e educação aos médicos, nossos valores são centrados no acolhimento e bem-estar de todos os envolvidos no acesso a Óleos Ricos em Canabinoides. Nosso portfólio se divide em três núcleos:

Aos Produtores de Cannabis Medicinal:
● Technical assessment;
● Estudo de Mercado e Viabilidade;
● Consultoria em internacionalização de marcas;
● Registro de produtos ricos em canabinoides no país;
● Branding e Posicionamento de marca;
● Estratégia de negócios;
● Representação comercial.

Aos Médicos:
● Consultoria Técnica e apoio em estudos sobre Terapia Canabinoide;
● Discussão de Casos Clínicos;
● Apoio em Estratégia Terapêutica na prática clínica;
● Manejo de interações medicamentosas.

A Pacientes e Familiares:
● Conexão entre pacientes e médicos prescritores;
● Resolução de trâmites de acesso Anvisa;
● Auxílio no processo de aquisição e logística de entrega;
● Acompanhamento terapêutico.

Contatos: (11) 99922/2170 ou 4858-6057

Year of foundation: 1968
Number of employees: 1,500
Manufacturing plants: 16 in the world
Investment in R&D: 5,4% of the annual turnover

With over 1,700 eco-friendly items and a production of 950,000 tons/year, Kerakoll is the world leader in products and services for GreenBuilding aimed at designing, building, and living in harmony with the environment and in healthy spaces.

The company mission is embrace and promote GreenBuilding as the new low environmental impact approach to building and promote higher quality homes around the world through the use of eco-friendly building materials and innovative solutions focusing on the environment and on improving both health and quality of life.

Notable among the architectural projects designed by internationally acclaimed architects who chose Kerakoll as their technological partner, are: 
• Studio ABDR for the new Teatro dell’Opera in Florence; 
• Zaha Hadid for Maxxi in Rome; 
• Herzog & De Meuron for the Beijing Olympic Sta¬dium and Allianz Arena in Monaco; 
• Frank O. Gehry for the Guggenheim Museum in Bilbao; 
• Santiago Calatrava for the Queen Sofia Palace of the Arts in Valencia.
